import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <div style={{textAlign: 'center',marginTop: '30px',}}>
      <button type="button" class="btn btn-primary" style={{marginLeft:'30px'}}>Create User</button>
      <button type="button" class="btn btn-primary" style={{marginLeft:'30px'}}>Users List</button>
    </div>
  )
}

export default App
